import './App.css';
import React, { useState } from 'react';
import Navbar from './Navbar';
import house from './housing.jpeg';
import Card from './Card';
import ai from './ai.jpeg';
import senior from './senior.jpeg';
import resgym from './resgym.jpg';
import houses from './houses.jpeg';

function App() {
  const [selectedFeature, setFeature] = useState(null);

  const handleCardSelect = (id) => {
    setFeature(id);
  };

  return (
    <div className="App">
      <Navbar />
      <div className='imageContainer'>
        <img src={house} alt='Housing image here' className='housingImage'/>
        <div className='textOverlay'>MEET YOUR SENIORS<br></br>FIND HOUSING<br></br>AND MORE!</div>
      </div>
      <Card
        id={1}
        image={senior}
        heading="Meet with Senior"
        text="This is some example text for the first card."
        onSelect={handleCardSelect}
      />
      <Card
        id={2}
        image={ai}
        heading="AI Chatbot and FAQs"
        text="This is some example text for the second card."
        onSelect={handleCardSelect}
      />
      <Card
        id={3}
        image={resgym}
        heading="Restaurants and Gyms Near Me"
        text="This is some example text for the third card."
        onSelect={handleCardSelect}
      />
      <Card
        id={4}
        image={houses}
        heading="Accommodation Listings"
        text="This is some example text for the third card."
        onSelect={handleCardSelect}
      />
    </div>
  );
}

export default App;
